import React from "react";
import { Card, CardContent } from "@/components/ui/card";
import { Button } from "@/components/ui/button";

const products = [
  { id: 1, price: "₹550", discount: "30%", rating: "★★★★★" },
  { id: 2, price: "₹550", discount: "30%", rating: "★★★★★" },
  { id: 3, price: "₹550", discount: "30%", rating: "★★★★★" },
  { id: 4, price: "₹550", discount: "30%", rating: "★★★★★" },
];

const categories = [
  { name: "Dogs", image: "dog.png" },
  { name: "Fish", image: "fish.png" },
  { name: "Cats", image: "cat.png" },
  { name: "Birds", image: "bird.png" },
];

const services = [
  "Pet Medical Administration",
  "Overnight Pet Care",
  "Puppy Day Care",
  "Training Trough Goodpup",
  "Pets House Sitting",
];

const BestSeller = () => (
  <section>
    <h2 className="text-2xl font-bold">Our Best Seller</h2>
    <div className="grid grid-cols-1 md:grid-cols-4 gap-4 mt-4">
      {products.map((product) => (
        <Card key={product.id} className="p-4">
          <CardContent>
            <p className="text-lg font-bold">{product.price}</p>
            <p>{product.rating}</p>
            <Button className="mt-2">Add To Cart</Button>
          </CardContent>
        </Card>
      ))}
    </div>
  </section>
);

const CategorySection = () => (
  <section>
    <h2 className="text-2xl font-bold">Our Category</h2>
    <div className="grid grid-cols-2 md:grid-cols-4 gap-4 mt-4">
      {categories.map((category) => (
        <Card key={category.name} className="p-4 flex items-center justify-center">
          <CardContent>
            <p className="text-lg font-bold">{category.name}</p>
          </CardContent>
        </Card>
      ))}
    </div>
  </section>
);

const GroomingServices = () => (
  <section>
    <h2 className="text-2xl font-bold">Grooming Services We Provide</h2>
    <ul className="list-disc pl-5 mt-2">
      {services.map((service, index) => (
        <li key={index}>{service}</li>
      ))}
    </ul>
  </section>
);

const PetStore = () => (
  <div className="container mx-auto p-6 space-y-10">
    <BestSeller />
    <CategorySection />
    <GroomingServices />
  </div>
);

export default PetStore;
